import React from 'react';
import './index.css';

class MyStatistics extends React.Component {
    constructor(props){
        super(props);
        this.title=[1,2,3,4,5]
    }
    render() {
        return (
        <div id="statistics">
            <div>
                <div>{this.title[0]}</div>
                <div>{this.props.totalequip}</div>
            </div>
            <div>運行中</div>
            <div>關機中</div>
            <div>報警中</div>
            <div>停機中</div>
        </div>
        );
    }
}
export default MyStatistics
